LaDonna Adrian Gaines (born December 31, 1948), known by her stage name, Donna Summer, is an American singer/songwriter who gained prominence during the disco era of the 1970s. She has a mezzo-soprano vocal range. Summer is a five-time Grammy winner and was the first artist to have three consecutive double albums reach number one on the US Billboard chart. She also charted four number-one singles in the US within a thirteen-month period. &lt;a href=&quot;
